import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import axios from 'axios';
import React, { useState, useEffect } from 'react';

import Header from "./components/Header";
import Home from "./pages/Home";
import Products from "./pages/Products";
import ProductPage from "./pages/ProductPage";
import ServerProductPage from "./pages/ServerProductPage"
import { productList } from "./assets/productList";

import ProductServerTest from "./pages/ProductServerTest";

function App() {
	const [products, setProducts] = useState([]);

    useEffect(() => {
        async function fetchProducts() {
            const response = await axios.get("http://localhost:4000/products");
            console.log(response.data.data)
            setProducts(response.data.data);
        }
        fetchProducts();
    }, []);

	return (
		<div className="App">
			<Header />
			<Router>
				<Routes>
					<Route path="/" element={<Home />} exact />
					<Route path="/products" element={<Products />} />
					{productList.map(item => (
						<Route key={item.id} path={`/products/${item.id}`} element={<ProductPage item={item} />} />
					))}
					<Route path="/productstest" element={<ProductServerTest />} />
					{products.map(item => (
						<Route key={item.id} path={`/serverproducts/${item.id}`} element={<ServerProductPage item={item} />} />
					))}
				</Routes>
			</Router>
		</div>
	);
}

export default App;
